INSERT INTO `pigcms_img` (`id`, `uid`, `uname`, `keyword`, `type`, `text`, `classid`, `classname`, `pic`, `spic`, `showpic`, `info`, `url`, `createtime`, `uptatetime`, `click`, `token`, `title`, `usort`) VALUES
(18, 7, '糖医师', '体质决定您是否易患糖尿病', '2', '', 0, '', '', 'uploads/logo.jpg', '1', '&lt;h2 class=&quot;rich_media_title&quot; id=&quot;activity-name&quot; style=&quot;font-weight:400;font-size:24px;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;&quot;&gt;\n	&lt;span style=&quot;color:#3E3E3E;font-size:16px;line-height:1.5;&quot;&gt;体质决定您是否易患糖尿病　　有人怕冷，有人怕热，有人爱出汗，有人爱喝水……每个人身体都有不同的特点，中医根据人体的不同特色，将人体体质分为九种类型，包括平和型、气虚型、阴虚型、阳虚型、湿热型、气郁型、痰湿型、血瘀型、特禀型。其中只有平和体质属于健康状态，其他八种体质都存在一定的问题，那么从体质角度讲，哪些人易得糖尿病呢？&lt;/span&gt;&lt;span style=&quot;color:#3E3E3E;font-size:16px;line-height:1.5;&quot;&gt;气郁体质&lt;/span&gt;\n&lt;/h2&gt;\n&lt;div class=&quot;rich_media_content&quot; id=&quot;js_content&quot; style=&quot;margin:0px;padding:0px;color:#3E3E3E;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;font-size:16px;&quot;&gt;\n	　　气郁体质的人属于郁闷派，这类人神情抑郁，忧虑脆弱，多为形体瘦弱。而这类人的性格特点就是典型的内向、敏感多疑。有关资料表明，因心理因素发病的糖尿病患者占60 ％ 以上，气郁体质的人会因为生活、事业、感情上不顺利，而长期抑郁成疾。所以气郁体质的人是糖尿病高发人群。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\n阴虚体质&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\n　　阴虚体质的人属于缺水派，这类人会表现为阴液亏少，口干舌燥，舌红少津，盗汗，体型偏瘦等。人体之阴为“阴精、营血、津液”的统称，是生命活动的物质基础。阴虚体质的人，体内长期处于津液不足，阳相对亢盛的状态，若阴虚持久，则易患消渴症，中医中的消渴就是指的糖尿病。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\n血瘀体质&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\n　　血瘀体质的人属于长斑派，这类人表现为肤色晦暗，易有瘀斑，舌底两根静脉粗大紫暗等。中医认为，瘀血是贯穿糖尿病发病始终的重要病机，特别是与糖尿病慢性并发症如视网膜病变、糖尿病肾病等微血管病变关系密切，所以说血瘀体质是糖尿病的好发体质。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\n痰湿体质&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\n　　痰湿体质的人表现为肥胖，腹部肥满，口黏苔腻，面部皮肤油脂多，多汗且粘，胸闷，痰多，口中发腻或发甜等。在中医角度，糖尿病在发病及病理演变过程中易出现痰湿之邪，而痰湿是导致糖尿病的重要发病基础。所以运用中医体质学说要重视糖尿病患者早期痰湿质的治疗，可以改善体质的偏颇，从而降低糖尿病的发病率。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\n气虚体质&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\n　　气虚体质属于气短派，这类人表现为元气不足，疲劳，声低，气短懒言懒动等。用通俗的话说就是这类人看上去没有精神，人如果没有精气神，身体抵抗力差，肯定容易生病。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\n个人体质倾向与糖尿病的发生、发展有密切的关系，血糖异常者可针对自身体质类型进行调理，往往能让糖尿病及其并发症的防治达到事半功倍的作用。\n&lt;/div&gt;', '', '1440742753', '1440742753', 10, 'mhfcjx1421158741', '体质决定您是否易患糖尿病', 1),
(19, 7, '糖医师', '糖友可以吃的水果都有哪些', '2', '', 0, '', '', 'uploads/logo.jpg', '1', '&lt;h2 class=&quot;rich_media_title&quot; id=&quot;activity-name&quot; style=&quot;font-weight:400;font-size:24px;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;&quot;&gt;\r\n	&lt;span style=&quot;color:#3E3E3E;font-size:16px;line-height:1.5;&quot;&gt;糖友可以吃的水果都有哪些&lt;/span&gt;&lt;span class=&quot;tn-Powered-by-XIUMI&quot; style=&quot;font-family:inherit;font-size:1em;font-weight:inherit;line-height:1.5;color:#FFFFFF;text-decoration:inherit;background-color:#F96E57;&quot;&gt;吃水果时间有讲究&lt;/span&gt;&lt;span style=&quot;color:#3E3E3E;font-size:16px;line-height:1.5;&quot;&gt;　　糖尿病患者“忌讳”糖分高食物众所周知。那香甜水嫩的水果是吃还是不吃呢？郭洁文表示，可以吃，但得要吃得有“技术含量”。&lt;/span&gt;\r\n&lt;/h2&gt;\r\n&lt;div class=&quot;rich_media_content&quot; id=&quot;js_content&quot; style=&quot;margin:0px;padding:0px;color:#3E3E3E;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;font-size:16px;&quot;&gt;\r\n	　　吃了水果必须减少主食。郭洁文表示，要把水果热量折算到患者一天摄入总热量中，以一天吃200克水果（一到两个中等大小左右水果）为例，则主食建议减少25克，这样才能保证全天饮食热量平衡。即把水果热量与其他食物进行等份交换，不能因吃水果而导致热量超标。同时，对于糖尿病患者，大前提是水果要少吃，切莫大量吃。大量吃可能造成血糖迅速升高，而高血糖持续时间长的话，则会加重胰腺负担。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　吃水果时间非常有讲究，忌餐前餐后吃，尤其不能在公众场合聚餐、饭后上果盘时大肆进食；宜作为“加餐”或睡前一小时吃。“加餐”即两个正餐之间进食水果，如上午9~10时、下午3~4时，也可直接作为加餐食品，既预防低血糖，又可保持血糖不发生大的波动。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　如果跟正餐一起吃，会导致胰岛素分泌、代谢受到影响，从而破坏其活性。所以对于又想吃水果又想控制血糖的患者，应为自己的水果餐制定科学规律的用餐时间。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　欲吃水果，您的血糖浓度应达到以下标准。否则请先用黄瓜、西红柿等代替水果吧。标准是：空腹血糖控制在140mg/dl以下，餐后2小时血糖控制在180mg/dl以下，糖化血红蛋白控制在7.5%以下，没有经常出现高血糖或低血糖。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　吃水果的数量：根据水果对血糖的影响，每天可食用200克左右的水果（可提供约90千卡的热量），同时应减少半两（25克）的主食，这就是食物等值交换办法，以使每日摄入的总热量保持不变。&lt;span class=&quot;tn-Powered-by-XIUMI&quot; style=&quot;color:#FFFFFF;font-size:1em;font-family:inherit;font-weight:inherit;text-decoration:inherit;background-color:#F96E57;&quot;&gt;糖友们吃什么水果好&lt;/span&gt;　　1、要尽量选取含糖低，含纤维素，黄体素，番茄红素丰富的黄瓜，西红柿，柚子，山楂，草莓，猕猴桃等。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　2、推荐选用：每一百克水果中含糖量少于十克的水果，包括青瓜、西瓜、橙子、柚子、柠檬、桃子、李子、杏、枇杷、菠萝、草莓、樱桃等。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　3、慎重选用：每一百克水果中包含糖量为十到二十克的水果，包括香蕉、石榴、甜瓜、橘子、苹果、梨、荔枝、芒果等。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　4、不宜选用：每一百克水果中含糖量大于二十克的水果，包括红枣、红果，特别是干枣、蜜枣、柿饼、葡萄干、杏干、桂圆等干果，以及果脯应禁止食用。含糖量特别高的新鲜水果，如红富士苹果、柿子、莱阳梨、肥城桃、哈密瓜、玫瑰香葡萄、冬枣、黄桃等也不宜食用。&lt;span class=&quot;tn-Powered-by-XIUMI&quot; style=&quot;color:#FFFFFF;font-size:1em;font-family:inherit;font-weight:inherit;text-decoration:inherit;background-color:#F96E57;&quot;&gt;降糖水果大搜罗&lt;/span&gt;　　杏 改善血液循环、调节血脂、保护血管；&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　樱桃增加人体内部胰岛素的含量；&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　草莓辅助降血糖；&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　李子适于虚劳有热型糖尿病；&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　山楂预防糖尿病血管并发症；&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　荔枝含有降血糖的物质；&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　橄榄预防冠心病、动脉粥样硬化的发生；&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　无花果低糖高纤维果晶；&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　西瓜适于糖尿病合并肾病的患者；&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　木瓜降低血糖；&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　桃子降低餐后血糖；&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　猕猴桃调节糖代谢；&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　橘子预防糖尿病患者发生视网膜出血；&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　柚子调节血糖水平；&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　柠檬预防脏器功能障碍等糖尿病并发症；&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　苹果减少血糖含量预防糖尿病；&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　菠萝减少对胰岛素和药物的依赖性；&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　椰子适于糖尿病烦渴多饮者；&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　石榴降低因糖尿病造成的心血管病风险。\r\n&lt;/div&gt;', '', '1440742820', '1440742820', 5, 'mhfcjx1421158741', '糖友可以吃的水果都有哪些', 19),
(20, 7, '糖医师', '糖尿病性视网膜病变的5种治疗方法', '2', '', 0, '', '', 'uploads/logo.jpg', '1', '&lt;h2 class=&quot;rich_media_title&quot; id=&quot;activity-name&quot; style=&quot;font-weight:400;font-size:24px;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;&quot;&gt;\r\n	&lt;span style=&quot;color:#3E3E3E;font-size:16px;line-height:1.5;&quot;&gt;糖尿病性视网膜病变的5种治疗方法　　糖尿病性视网膜病变是糖尿病性微血管病变的一种表现，严重影响糖尿病患者的视力，最终可导致严重视力下降甚至完全失明。目前治疗的方法主要包括控制血糖、药物保守治疗、激光治疗、玻璃体切除术及定期散瞳检查眼底。&lt;/span&gt;\r\n&lt;/h2&gt;\r\n&lt;div class=&quot;rich_media_content&quot; id=&quot;js_content&quot; style=&quot;margin:0px;padding:0px;color:#3E3E3E;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;font-size:16px;&quot;&gt;\r\n	　　1、控制血糖：糖尿病性视网膜病变主要与糖尿病病程与血糖控制程度有关，应尽可能将血糖控制在正常范围，当口服药不能使高血糖降低时则需注射胰岛素。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　2、药物保守治疗：非增生性视网膜病变型患者除严格控制糖尿病及高血压、高血脂等合并症外，可采用二羟基苯磺酸钙类药物、抗血小板聚集药、抗凝药物及促纤溶药物等进行治疗。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　3、激光治疗：糖尿病性视网膜病变进行激光光凝治疗也可阻止视网膜病变的发展。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　4、玻璃体切除术：晚期增生性糖尿病性视网膜病变可发生严重玻璃体出血，可采用玻璃体切除术使屈光间质清晰，吸出碎片以消除纤维组织赖以生长的支架，松解对视网膜的牵拉，恢复正常的视网膜解剖关系，保持眼球完整，以便作激光光凝或冷凝。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　5、定期散瞳检查眼底：糖尿病患者应定期散瞳检查眼底，1型糖病患者发病5年后应每年检查1次，2型糖尿病患者从发病起应每年检查1次，如有异常应缩短检查时间。\r\n&lt;/div&gt;', '', '1440742857', '1440742857', 8, 'mhfcjx1421158741', '糖尿病性视网膜病变的5种治疗方法', 20),
(21, 7, '糖医师', '1型和2型糖尿病的临床特点有何区别', '2', '', 0, '', '', 'uploads/logo.jpg', '1', '&lt;h2 class=&quot;rich_media_title&quot; id=&quot;activity-name&quot; style=&quot;font-weight:400;font-size:24px;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;&quot;&gt;\r\n	&lt;span style=&quot;color:#3E3E3E;font-size:16px;line-height:1.5;&quot;&gt;1型和2型糖尿病的临床特点有何区别　　大多数1型糖尿病患者在40岁之前发病，20岁以下的青少年和儿童患的绝大多数糖尿病多为1型糖尿病。2型糖尿病的主要发病人群为40岁以上的中老年人，50岁以上的糖尿病患者大多数都是2型糖尿病患者。&lt;/span&gt;\r\n&lt;/h2&gt;\r\n&lt;div class=&quot;rich_media_content&quot; id=&quot;js_content&quot; style=&quot;margin:0px;padding:0px;color:#3E3E3E;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;font-size:16px;&quot;&gt;\r\n	　　患有2型糖尿病的患者常为明显超重或肥胖者，肥胖越明显，越易患2型糖尿病;1型糖尿病患者在起病前体重多属正常或降低。无论是1型糖尿病或2型糖尿病，在发病之后体重一般都会有不同程度的降低，而1型糖尿病患者由于血糖控制不理想，往往消瘦得更明显。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　糖尿病的典型症状为三多一少，即多饮、多食、多尿，体重减轻。1型糖尿病患者一般均有明显的临床症状，而2型糖尿病常无典型的三多一少症状。由于大多数2型糖尿病患者临床症状不明显，常常难以确定何时起病，部分患者是在检查血糖时才发现自己患有糖尿病，而部分患者在出现糖尿病并发症后，在检查身体过程中发现血糖升高。而1型糖尿病患者由于起病初期症状就比较突出，故一般能确切地指出自己的起病时间。\r\n&lt;/div&gt;', '', '1440742904', '1440742904', 9, 'mhfcjx1421158741', '1型和2型糖尿病的临床特点有何区别', 21),
(22, 7, '糖医师', '4技巧帮助糖尿病患者成功注射胰岛素', '2', '', 0, '', '', 'uploads/logo.jpg', '1', '&lt;h2 class=&quot;rich_media_title&quot; id=&quot;activity-name&quot; style=&quot;font-weight:400;font-size:24px;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;&quot;&gt;\n	&lt;span style=&quot;color:#3E3E3E;font-size:16px;line-height:1.5;&quot;&gt;4技巧帮助糖尿病患者成功注射胰岛素　　不少糖尿病患者为方便，经医生指导后常自行注射胰岛素控制病情，却不能达到较好的疗效，实际上，注射胰岛素大有学问，糖尿病患者不妨先学习。&lt;/span&gt;\n&lt;/h2&gt;\n&lt;div class=&quot;rich_media_content&quot; id=&quot;js_content&quot; style=&quot;margin:0px;padding:0px;color:#3E3E3E;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;font-size:16px;&quot;&gt;\n	　　1、注射前充分消毒--糖尿病患者注射胰岛素前应对注射部位的皮肤进行彻底消毒，一般选择碘伏，待碘伏完全挥发再注射可预防刺痛。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\n　　2、避免同一部位多次注射--反复在同一部位注射胰岛素会导致该部位皮下脂肪增生，注射时应避免在同一部位多次注射，可经常轮换，避免产生硬结和脂肪肉瘤。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\n　　3、注射时间与注射部位统一--在同一时间注射同一部位可以降低血糖波动性，确保吸收速度和吸收率一致，可以在早晨进行腹部注射，中午进行手臂注射，晚上进行臀部注射等。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\n　　4、根据药效选择合适注射部位--皮下组织的厚度直接影响胰岛素的吸收速度、吸收率，使用短效胰岛素或短效与中效混合的胰岛素时，一般选择皮下组织相对较薄的腹部和上臂，中长效胰岛素要求缓慢吸收，最合适的注射部位就是皮下组织较厚的臀部或大腿。\n&lt;/div&gt;', '', '1440742936', '1440742936', 10, 'mhfcjx1421158741', '4技巧帮助糖尿病患者成功注射胰岛素', 22),
(23, 7, '糖医师', '多吃糖会导致糖尿病吗', '2', '', 0, '', '', 'uploads/logo.jpg', '1', '&lt;h2 class=&quot;rich_media_title&quot; id=&quot;activity-name&quot; style=&quot;font-weight:400;font-size:24px;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;&quot;&gt;\r\n	&lt;span style=&quot;color:#3E3E3E;font-size:16px;line-height:1.5;&quot;&gt;多吃糖会导致糖尿病吗　“不要吃那么多的糖，要不会得糖尿病的!”我们经常会听到周围的人善意的提醒，那么多吃糖是不是会引发糖尿病呢?答案是否定的，吃糖和患有糖尿病没有直接相关性。&lt;/span&gt;\r\n&lt;/h2&gt;\r\n&lt;div class=&quot;rich_media_content&quot; id=&quot;js_content&quot; style=&quot;margin:0px;padding:0px;color:#3E3E3E;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;font-size:16px;&quot;&gt;\r\n	　　是否发生糖尿病是与遗传因素紧密相关的，父母为糖尿病患者的人患糖尿病的风险极大，具有糖尿病家族史的人群糖尿病发病率明显高于没有家族史的人群。具有糖尿病遗传倾向的人群在一定外界诱因的作用下就可能发病，而如果注意饮食和生活调节，就可能避免糖尿病发病。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　实际上糖并不只是指日常使用的白砂糖、水果糖、巧克力糖等，糖包括单糖、多糖和双糖，碳水化合物类食物，即主食类食物也属于多糖类食物。无论哪一种糖类都不会直接导致糖尿病，但如果长期多吃糖类食物会导致多余的热量摄入，引发肥胖而有可能导致胰岛素抵抗引起糖尿病;并且多吃糖类食物可使许多隐性糖尿病患者迅速转为显性，特别是一些老年人糖尿病患者。老年人属于糖尿病高危人群，年龄越大越容易患上糖尿病。不少老年人可能出现轻微的高血糖，由于病情轻微常不出现明显的症状，但在食用糖类后就可能出现严重的高血糖。\r\n&lt;/div&gt;', '', '1440742970', '1440742970', 6, 'mhfcjx1421158741', '多吃糖会导致糖尿病吗', 23),
(24, 7, '糖医师', '儿童糖尿病有先兆吗？', '2', '', 0, '', '', 'uploads/logo.jpg', '1', '&lt;h2 class=&quot;rich_media_title&quot; id=&quot;activity-name&quot; style=&quot;font-weight:400;font-size:24px;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;&quot;&gt;\r\n	&lt;span style=&quot;color:#3E3E3E;font-size:16px;line-height:1.5;&quot;&gt;儿童糖尿病有先兆吗？　　最近几年，糖尿病有低龄化势头。很多儿童患上糖尿病。但是由于现在医学水平的有限，社会对儿童糖尿病的认识非常有限，而且Ⅱ型糖尿病的发病症状也不明显。所以家长们要充分了解糖尿病的发病预兆，对孩子出现的一些异常反应给予足够的重视，及时发现糖尿病，并进行诊断和治疗，减轻疾病对孩子的伤害。　　&lt;/span&gt;&lt;span style=&quot;color:#3E3E3E;font-size:16px;line-height:1.5;&quot;&gt;a.孩子在一段时期内出现小便频繁现象，多年不尿床的孩子多次出现尿床现象，家长应该带孩子进行糖尿病检查。&lt;/span&gt;\r\n&lt;/h2&gt;\r\n&lt;div class=&quot;rich_media_content&quot; id=&quot;js_content&quot; style=&quot;margin:0px;padding:0px;color:#3E3E3E;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;font-size:16px;&quot;&gt;\r\n	　　b.出现频繁口渴现象，甚至夜间多次起床喝水的情况。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　c.突然消瘦。孩子正处于生长发育期，体重应该是连续稳定上升的势头，但突然出现体重下降情况，家长务必要警惕。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　d.疲乏无力。孩子本来处于精力较为旺盛的生长发育期，应该多动，但突然在一段时间内老喜欢待在家里，不喜欢户外活动，精神较为委靡，就有可能是患上了糖尿病。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　e.饭量大增。这个特点很容易被忽略，家长多认为是孩子生长发育中的正常情况，但应注意是否出现其他糖尿病征兆。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　f.容易引起感染。孩子一些伤口反复出现感染情况，很长时间不容易愈合。而Ⅰ型糖尿病的发病原因之一就是病毒感染引起胰岛素分泌不足。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　g.出现频繁腹痛和呕吐现象。这种情况很容易被误诊为肠胃疾病而加重病情，家长要对孩子平时的生活和精神状态有足够掌握，以便提供给医生足够的诊断信息。\r\n&lt;/div&gt;', '', '1440743015', '1440743015', 5, 'mhfcjx1421158741', '儿童糖尿病有先兆吗？', 24),
(25, 7, '糖医师', '糖尿病患者如何开始自己的怀孕计划', '2', '', 0, '', '', 'uploads/logo.jpg', '1', '&lt;h2 class=&quot;rich_media_title&quot; id=&quot;activity-name&quot; style=&quot;font-weight:400;font-size:24px;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;&quot;&gt;\r\n	&lt;span style=&quot;color:#3E3E3E;font-size:16px;line-height:1.5;&quot;&gt;糖尿病患者如何开始自己的怀孕计划　　患有糖尿病的女性过去普遍被告知不要考虑生育，因为孕期血糖水平升高不但会加重孕妇的糖尿病，也会导致死胎率和出生缺陷增高，造成双重危害。随着糖尿病治疗和胎儿和新生儿护理的进步，只要糖尿病患者在怀孕前和整个孕期的血糖尽可能保持正常，就可能顺利地怀孕，生个健康的孩子。&lt;/span&gt;\r\n&lt;/h2&gt;\r\n&lt;div class=&quot;rich_media_content&quot; id=&quot;js_content&quot; style=&quot;margin:0px;padding:0px;color:#3E3E3E;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;font-size:16px;&quot;&gt;\r\n	　　育龄期糖尿病患者多为1型糖尿病患者，在准备怀孕前应与产科医生、内分泌科医生及营养师共同制定出怀孕计划。患者应了解怀孕前和怀孕期间保持正常血糖的重要性，怀孕对于母亲和孩子潜在的危险性，获取遗传学咨询以及避孕的建议。怀孕计划应包括详尽的胰岛素应用方案、细致的营养管理、体育锻炼及经常性的血糖水平检测。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　怀孕之前糖尿病患者的血糖应尽可能达到正常水平，美国糖尿病协会推荐的在怀孕前血糖水平自我监测应达到的目标为：餐前血糖4.44~6.11mmol/L，餐后2小时血糖&amp;lt;8.6mmol/L。如果在怀孕前能将糖化血红蛋白保持在正常值以上1%处，或低于这一水平，即糖化血红蛋白低于7%，母亲发生糖尿病并发症的几率会大大降低。TIPS：血糖1mg/dl=0.0555mmol/L。\r\n&lt;/div&gt;', '', '1440743046', '1440743046', 8, 'mhfcjx1421158741', '糖尿病患者如何开始自己的怀孕计划', 25),
(26, 7, '糖医师', '糖尿病的鉴别诊断', '2', '', 0, '', '', 'uploads/logo.jpg', '1', '&lt;h2 class=&quot;rich_media_title&quot; id=&quot;activity-name&quot; style=&quot;font-weight:400;font-size:24px;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;&quot;&gt;\r\n	&lt;span style=&quot;color:#3E3E3E;font-size:16px;line-height:1.5;&quot;&gt;糖尿病的鉴别诊断　　有多种非糖尿病因素及疾病可引起葡萄糖耐量减低或空腹高血糖，须与原发性糖尿病相鉴别。&lt;/span&gt;\r\n&lt;/h2&gt;\r\n&lt;div class=&quot;rich_media_content&quot; id=&quot;js_content&quot; style=&quot;margin:0px;padding:0px;color:#3E3E3E;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;font-size:16px;&quot;&gt;\r\n	　　(1)内分泌疾病：诊断糖尿病(原发性)时，应除外下述内分泌疾病：①肢端肥大症。因生长激素分泌过多，拮抗胰岛素作用引起糖代谢紊乱，可出现垂体性糖尿病症状，故临床上患者常表现为糖耐量减低，或并发糖尿病。应与原发性糖尿病鉴别，典型肢端肥大症症状常有助于诊断。因为肢端肥大症的治疗效果不很理想，所以糖代谢恢复正常的机会亦较少。②甲状腺机能亢进症。甲状腺激素过多使肝糖原分解增加，加速新陈代谢。此外，甲状腺素能提高人体对儿茶酚胺的敏感性，抑制胰岛素的分泌，使机体代谢亢进，葡萄糖的利用和氧化增加，肠道对糖类的吸收加速，加重了胰岛的负担而诱发糖尿病。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　(2)肝脏疾病：肝病患者糖代谢异常较多见，空腹血糖降低或正常，但葡萄糖耐量减低。这是因为肝脏储备糖原能力减弱，糖异生及胰岛功能降低。肝炎病毒累及胰岛β-细胞而诱发的糖尿病，大都是可逆的。本病有肝炎病史，同时作血磷检查，可以鉴别肝病或糖尿病所致的糖耐量减低。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　(3)慢性肾脏疾病：慢性肾脏疾病后期及尿毒症与一般消耗性疾病相似，可有轻度糖耐量减低。可能与本病引起电解质紊乱，细胞内缺钾，影响胰岛素释放，而致糖耐量异常。也可因肾小管对糖的重吸收功能障碍，而致肾性糖尿黄色小说。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　(4)肥胖症：肥胖者因体内肥大的脂肪细胞，使单位面积脂肪细胞膜上的胰岛素受体数目相对减少，对胰岛素的亲和力降低和不敏感，故对胰岛素的需要量增加。久之，导致胰岛β-细胞功能下降，而致糖耐量减低。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　(5)急性应激状态：当患者感染、外伤、手术、急性心肌梗死、脑血管病等应激情况下，易引起体内肾上腺皮质激素分泌增多，可引起一时性高血糖或糖耐量降低，待应激因素消除后，血糖可以恢复正常。若高血糖或糖耐量异常持续时间较久者，则应考虑为糖尿病。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　(6)药物：某此药物可以影响糖耐量，但停药后可逐步恢复。\r\n&lt;/div&gt;', '', '1440743076', '1440743076', 2, 'mhfcjx1421158741', '糖尿病的鉴别诊断', 26),
(27, 7, '糖医师', '糖尿病患者发病的内因和外因', '2', '', 0, '', '', 'uploads/logo.jpg', '1', '&lt;h2 class=&quot;rich_media_title&quot; id=&quot;activity-name&quot; style=&quot;font-weight:400;font-size:24px;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;&quot;&gt;\r\n	&lt;span style=&quot;color:#3E3E3E;font-size:16px;line-height:1.5;&quot;&gt;糖尿病患者发病的内因和外因　　糖尿病的发病原因多种多样，包括内因和外因，如遗传、病毒感染、自身免疫、继发于其他疾病等。大多数糖尿病患者的病因并不明确，可能是遗传因素和环境因素共同作用而导致疾病发生发展的。&lt;/span&gt;\r\n&lt;/h2&gt;\r\n&lt;div class=&quot;rich_media_content&quot; id=&quot;js_content&quot; style=&quot;margin:0px;padding:0px;color:#3E3E3E;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;font-size:16px;&quot;&gt;\r\n	　　遗传是糖尿病发病的重要因素，部分糖尿病患者中明确有遗传因素的影响，如孪生兄弟或姐妹之中，一方发生糖尿病，另一方发生糖尿病的机率为50%，同卵双生者常同时发病，父母均为糖尿病患者，其子女的发病风险较父母为非糖尿病者明显增高。现在多认为糖尿病为多基因遗传病，疾病的发生不是由某个基因决定的，而是基因量达到或超过其阈值时才有发病的可能。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　许多糖尿病发生于风疹病毒、腮腺炎病毒、腺病毒、柯萨奇病毒等感染后，其发病机制可能与病毒感染导致病毒性胰腺炎有关。部分患者体内发现了抗胰岛β细胞抗体，病理检查也可看到胰岛中有淋巴细胞和嗜酸性粒细胞的浸润现象。某些1型糖尿病患者在发病早期应用免疫抑制治疗可以得到良好的效果，甚至痊愈。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　肾上腺皮质功能亢进、功能性垂体腺瘤、嗜铬细胞瘤等都可以引起继发性糖尿病，即症状性糖尿病，长期应用利尿剂、皮质激素、肾上腺能药物者，都可能导致或促使糖尿病加重。\r\n&lt;/div&gt;', '', '1440743108', '1440743108', 4, 'mhfcjx1421158741', '糖尿病患者发病的内因和外因', 27),
(28, 7, '糖医师', '糖尿病患者必知6招提高胰岛素疗效', '2', '', 0, '', '', 'uploads/logo.jpg', '1', '&lt;h2 class=&quot;rich_media_title&quot; id=&quot;activity-name&quot; style=&quot;font-weight:400;font-size:24px;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;&quot;&gt;\r\n	&lt;span style=&quot;color:#3E3E3E;font-size:16px;line-height:1.5;&quot;&gt;糖尿病患者必知6招提高胰岛素疗效　　1型糖尿病患者自身胰岛β细胞功能受损，胰岛素分泌绝对不足，常需终生胰岛素替代治疗，日常生活中注意以下几点，有助于提高胰岛素疗效。&lt;/span&gt;\r\n&lt;/h2&gt;\r\n&lt;div class=&quot;rich_media_content&quot; id=&quot;js_content&quot; style=&quot;margin:0px;padding:0px;color:#3E3E3E;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;font-size:16px;&quot;&gt;\r\n	　　1、控制体重：超重和肥胖可造成胰岛素抵抗和胰岛素敏感性降低，糖尿病患者应积极控制体重，以减少胰岛素的用量，保护胰岛细胞分泌胰岛素的正常功能。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　2、改善代谢异常：糖尿病患者同时存在高脂血症、血液高黏状态、高尿酸血症等多种代谢异常可降低胰岛素敏感性，应积极改善。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　3、适当增加运动量：适宜的运动有助于胰岛素发挥作用，加速机体有关组织如肌肉、脂肪等对于葡萄糖的利用，在一定程度可以增加胰岛素敏感性。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　4、剂量适宜：胰岛素的使用剂量应该根据饮食和运动习惯的变化微微调整，合理使用各餐胰岛素，安全控制血糖。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　5、选择合适剂型：糖尿病患者使用动物胰岛素的剂量会大于人胰岛素或人胰岛素类似物的剂量，应根据不同情况选用合适的胰岛素类型。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　6、使用胰岛素增敏剂：罗格列酮、吡格列酮、二甲双胍等胰岛素增敏剂可以增加肌肉、脂肪、肝脏等组织对胰岛素的敏感性，改善胰岛素抵抗，减少胰岛素用量。\r\n&lt;/div&gt;', '', '1440743133', '1440743133', 7, 'mhfcjx1421158741', '糖尿病患者必知6招提高胰岛素疗效', 28),
(29, 7, '糖医师', '人们有必要知道些有关糖尿病的症状表现', '2', '', 0, '', '', 'uploads/logo.jpg', '1', '&lt;h2 class=&quot;rich_media_title&quot; id=&quot;activity-name&quot; style=&quot;font-weight:400;font-size:24px;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;&quot;&gt;\r\n	&lt;span style=&quot;color:#3E3E3E;font-size:16px;line-height:1.5;&quot;&gt;人们有必要知道些有关糖尿病的症状表现　　糖尿病是一种常见的内科疾病，给很多人的生活造成了一定的影响，而人们多不重视糖尿病的症状，就可能会影响到患者的病情，最终危害到健康。所以大家要提前了解些糖尿病的症状，才能尽早的发现病情。下面就来看看糖尿病的症状有哪些表现。&lt;/span&gt;\r\n&lt;/h2&gt;\r\n&lt;div class=&quot;rich_media_content&quot; id=&quot;js_content&quot; style=&quot;margin:0px;padding:0px;color:#3E3E3E;font-family:&apos;Hiragino Sans GB&apos;, &apos;Microsoft YaHei&apos;, Arial, sans-serif;font-size:16px;&quot;&gt;\r\n	　　糖尿病的症状有：&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　1、眼睛容易疲劳，视力急剧下降。当感到眼睛很容易疲劳，看不清东西，站起来时眼前发黑，眼皮下垂，视界变窄，看东西模糊不清。这些就属于糖尿病的症状表现。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　2、糖尿病的症状还会有麻木、发冷感。常有蚂行感或麻木感，由于温度感丧失、痛觉迟钝而易发生下肢各种创伤和感染。这些也属于糖尿病的症状表现。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　3、由于大量尿糖的丢失，食量增加。同时又因高血糖刺激胰岛素分泌，因而病人易产生饥饿感，食欲亢进，老有吃不饱的感觉。这些糖尿病的症状也比较常见。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　4、由于胰岛素不足，机体不能充分利用葡萄糖，使脂肪和蛋白质分解加速来补充能量和热量，病人体重减轻、形体消瘦，严重者体重可下降数十斤，以致疲乏无力，精神不振，这也是糖尿病的症状表现。&lt;br class=&quot;tn-Powered-by-XIUMI&quot; /&gt;\r\n　　以上所描述的内容就是糖尿病的症状，希望大家能一一了解。只要知道这些糖尿病的症状，就可以让患者尽早的接受治疗，到时就能有效地控制病情。因此要想患者早点恢复，就请大家多多警惕这些糖尿病的症状表现。祝各位患者能早日康复。\r\n&lt;/div&gt;', '', '1440743157', '1440743157', 20, 'mhfcjx1421158741', '人们有必要知道些有关糖尿病的症状表现', 29);
